import axios from "axios";
const API_URL = 'http://localhost:5000'

export const fetchProducts = () => {
    try {
        return axios.get(`${API_URL}/api/products`);
    }
    catch(err){
        return -1;
    }
}

export const productDetails = (id) => {
    try {
        returnaxios.get(`${API_URL}/api/products/${id}`)
    }
    catch(err){
        return -1;
    }
}
